<script type="text/javascript">
function getSearchString(name){
	var reg= new RegExp('(^|&)' + name + '=([^&]*)(&|$)', 'i');
	var r=window.location.search.substr(1).match(reg);
	if(r != null){
		return unescape(r[2]);
	}
	return null;
}
function tr4Data($name1, $info1, $name2, $info2){
	var out="";
	out="<tr><th>"+$name1+"</th>";
	out=out+"<td>"+$info1+"</td>";
	if($info2!=""){
		out=out+"<th>"+$name2+"</th>";
		out=out+"<td>"+$info2+"</td></tr>";
	}else{
		out=out+"<th></th><td></td></tr>";
	}
	return out;
}
function StringLink($link, $id){
	var out="-";
	if($id != "-"){
		out="<a target='_blank' href='"+$link+$id+"'>"+$id+"</a>";
	}
	return out;
}
$.SeqSVG=function($Seq, $location){
	var $len= $Seq.length;
	var $out="<svg width='100%' height='100%' version='1.1' xmlns='http://www.w3.org/2000/svg'>";
	var y=15;
	var $width=800;
	$out=$out+"<rect x='110' y="+y+" width='"+$width+"' height='20' rx='4' ty='4' stroke='black' fill='#FFEFD5'></rect>";
	$out=$out+"<text x='100' y="+(y+36)+" font-size='16'>"+1+"</text>";	// Scale
	$out=$out + "<text x='"+($width+113)+"' y="+(y+36)+">"+$len+"</text>";
	// 
	var $one=$width/$len;
	var $degron=$location.split("-");
	var $x=$one * $degron[0] +110;
	$out=$out+"<rect class='degron' x='"+$x+"' y="+y+" width='"+(0.8*$one*($degron[1]-$degron[0]))+"' height='20' fill='#FF7F50' ></rect>";
	//
	var $parts=$Seq.substr($degron[0]-1,$degron[1]-$degron[0]+1);
	$out=$out + "<text x='"+$x+"' y="+(y+40)+" style='text-anchor:middle'>"+$degron[0]+" "+$parts+" "+$degron[1]+"</text>";
	//
	$out=$out + "<defs><style>#load{stroke-dasharray:"+length+"; stroke-dashoffset:"+length+"; animation: strokeanim 10s forwards;}</style></defs>";
	$out=$out + "</svg>";
	$("#SeqSVG").html($out);
}
function SeqShow($seq, $location){
	var $seqDisplay='';
	var $len= $seq.length;
	var $nla = Math.floor($len/10);
	var $i=0;
	var $one=$location.split("-");
	while($i<=$nla){
		var $parts=$seq.substr($i*10,10);
		if($one[0]>=$i*10 & $i*10+10>=$one[0] & $i*10+10<=$one[1]){
			if($one[0]-$i*10 <=10 & $i*10-$one[0]<=0){
				$parts =$seq.substr($i*10,$one[0]-$i*10-1);
				var now=$i*10;
				if($i*10-$one[0]<0){
					now=$one[0]-1;
				}
				$parts =$parts+"<u>"+$seq.substr(now,$i*10+10-now)+"</u>";
			}
		}else if($one[0]>=$i*10 & $i*10+10>=$one[0] & $i*10+10>=$one[1]){
			$parts =$seq.substr($i*10,$one[0]-$i*10-1);
			var now=$i*10;
			if($i*10-$one[0]<0){
				now=$one[0]-1;
			}
			$parts =$parts+"<u>"+$seq.substr(now,$one[1]-now)+"</u>";
			$parts =$parts+$seq.substr($one[1],$i*10+10-$one[1]);
		}else if($i*10>$one[0] & $i*10+10-$one[1]>=0 & $i*10-$one[1]<=0){
			$parts ="<u>"+$seq.substr($i*10,$one[1]-$i*10)+"</u>";
			$parts =$parts+$seq.substr($one[1],$i*10+10-$one[1]);
		}
		if($i>8 && $i%9==0){
			var $total = $i*10;
			$seqDisplay = $seqDisplay+$total+"<br>"+$parts+" ";
		}else{
			$seqDisplay = $seqDisplay+$parts+" ";
		}
		$i++;
	}
	$seqDisplay = $seqDisplay+$len;
	return $seqDisplay;
}
function Structure(pdb, location){
	var out="";
	var one=pdb.split(";;");
	for(i=0;i<one.length;i++){
		var two=one[i].split(",,");
		out=out+"<tr><td><a  target='_blank' href='https://www.rcsb.org/structure/"+two[0]+"'>"+two[0]+"</a></td><td>"+two[1]+"</td><td>"+two[4]+"-"+two[5]+"</td></tr>";
		// out=out+"<tr><td><a  target='_blank' href='https://www.rcsb.org/structure/"+two[0]+"'>"+two[0]+"</a></td><td>"+two[1]+"</td><td>"+two[4]+"-"+two[5]+"</td><td><button>Show</button></td></tr>";
	}
	//
	var two=one[0].split(",,");
	$("#PDBshow h4").append(two[0]);
	$("#PDBshow").append("<div style='height: 400px; width: 400px; position: relative;' class='viewer_3Dmoljs' data-pdb='"+two[0]+"' data-backgroundcolor='0xffffff' data-style='cartoon' data-select1='chain:"+two[1]+";resi:["+'"'+location+'"'+"]'  data-style1='cartoon:color=spectrum' data-surface1='opacity:.1;color:white'></div>");
	return out;
}
function PPIs(ppi, gene){
	var cy = cytoscape({
		container: $('#cy'),
		elements: [{data:{id:gene}, style:{'background-color':'magenta'}}],
		style: [ {selector: 'node', style: {'background-color': '#666', 'label': 'data(id)', 'width':15, 'height':15}},{selector: 'edge', style: { 'width': 2, 'line-color': '#ccc', 'target-arrow-color': '#ccc', 'target-arrow-shape': 'triangle', 'curve-style': 'bezier'} }],
	});
	var out="";
	var one=ppi.split(";;");
	for(i=0;i<one.length;i++){
		var two=one[i].split(",,");
		two[2]=two[2].replace(/;/g,"<br/>");
		out=out+"<tr><td>"+StringLink("https://www.uniprot.org/uniprotkb/", two[0])+"</a></td><td>"+two[1]+"</td><td>"+two[2]+"</td></tr>";
		cy.add([{group:'nodes', data: {id:two[1]}},{group: 'edges', data: { id: i, source: two[1], target: gene } }]);
	}
	var layout = cy.layout({ name: 'cose',  idealEdgeLength: function( edge ){ return 100; }}).run();
	// cy.$id(gene).pan({x:200,y:200});
	// cy.$id(gene).style('background-color', 'magenta').update();
	$("#PPIs h4").append("Interacting proteins (E3/DUB): <strong>"+one.length+"</strong>.");
	return out;
}
